import {Link } from 'react-router-dom'
class NavBar extends React.Component{
  render(){
    return(
      <div className="navbar">
        <Link className="navbar navbu">Home</Link>
        <Link className="navbar navbu">About</Link>
      </div>
    )
  }
}

export default NavBar
